                <h1 id='id56' data-uip-name='html.h' data-uip-properties='{"text":"Overview","rank":"h1"}'></h1>
                <img id='id95' data-uip-name='html.img' data-uip-properties='{"src":"http://www.s-core.co.kr/resources/img/main_image.jpg"}'>
                <textarea id='id2' data-uip-name='html.textarea' data-uip-properties='{"text":"당사는 외산 소프트웨어 제품 독점이었던 기업용 소프트웨어 시장에서 독자 기술로 국산 제품을 개발하여 한국 소프트웨어 기술의 자존심을 굳건히 지켜온 기업입니다.\n\n국내에서 유일하게 국산 윈도우용 OS(운영체계) 및 브라우저 오피스 프로그램, 임베디드 S/W 개발 경험을 보유한 기업입니다.\n\n우수한 인적 자원과 전문 기술력을 바탕으로 창의적이고 도전적인 연구개발 문화 아래 최고의 시스템 S/W, 솔루션 회사를 목표로 에스코어 전 임직원이 최선을 다하고 있습니다.","disabled":"","placeholder":"Input text.","readonly":""}'></textarea>
